import React, { Component } from 'react';
import axios from 'axios';

export default class Preview extends Component {
    constructor(props) {
        super(props);
        
        this.state = {
            name: '',
            description: '',
            numOfReps: '',
            url: '',
            date: new Date()
        }
    }


    render() {
        return(
            <div>
                {this.props.data}
                {this.state.name}
            </div>
        )
    }
}
